using Picturesque.Domain;
using System;
using System.Collections.Generic;
using System.Text;

namespace Picturesque.DB
{
    public static class InitialPictures
    {
        public static void Seed(PicturesqueDbContext ctx)
        {
            foreach (var picture in GetInitialPictures())
            {
                ctx.Pictures.Add(picture);
            }
            ctx.SaveChanges();
        }

        public static List<Picture> GetInitialPictures()
        {
            // These are pictures of cats
            return new List<Picture>()
            {
                new Picture("data:image/jpeg;base64,"),
                new Picture("data:image/png;base64,"),
                new Picture("data:image/jpeg;base64,"),
                new Picture("data:image/jpeg;base64,"),
                new Picture("data:image/jpeg;base64,"),
                new Picture("data:image/jpeg;base64,"),
                new Picture("data:image/jpeg;base64,"),
                new Picture("data:image/jpeg;base64,")
            };
        }
    }
}
